import React from "react";
import styled from "styled-components";

const StyledInput = styled.input``;

export default function Input({ type, onChange, value, placeholder }) {
  return (
    <StyledInput
      type={type}
      placeholder={placeholder}
      value={value}
      onChange={onChange}
    />
  );
}
